///////////////////////
// Welcome to Cursor //
///////////////////////

/*
Step 1: Try generating a react component that lets you play tictactoe with Cmd+K or Ctrl+K on a new line.
  - Then integrate it into the code below and run with npm start

Step 2: Try highlighting all the code with your mouse, then hit Cmd+k or Ctrl+K. 
  - Instruct it to change the game in some way (e.g. add inline styles, add a start screen, make it 4x4 instead of 3x3)

Step 3: Hit Cmd+L or Ctrl+L and ask the chat what the code does

Step 4: To try out cursor on your own projects, go to the file menu (top left) and open a folder.
*/


import React, { useState, useEffect, useCallback } from 'react';
import ReactDOM from 'react-dom/client';

const GAME_WIDTH = 600;
const GAME_HEIGHT = 150;
const DINO_WIDTH = 40;
const DINO_HEIGHT = 43;
const CACTUS_WIDTH = 23;
const CACTUS_HEIGHT = 46;
const GROUND_HEIGHT = 10;

function App() {
  const [gameStarted, setGameStarted] = useState(false);
  const [dinoY, setDinoY] = useState(GAME_HEIGHT - DINO_HEIGHT - GROUND_HEIGHT);
  const [cactusX, setCactusX] = useState(GAME_WIDTH);
  const [score, setScore] = useState(0);
  const [highScore, setHighScore] = useState(0);
  const [isJumping, setIsJumping] = useState(false);

  const jump = useCallback(() => {
    if (!isJumping) {
      setIsJumping(true);
      let jumpHeight = 0;
      const jumpInterval = setInterval(() => {
        if (jumpHeight < 60 && jumpHeight >= 0) {
          setDinoY(y => y - 3);
          jumpHeight += 3;
        } else if (jumpHeight >= 60 && jumpHeight < 120) {
          setDinoY(y => y + 3);
          jumpHeight += 3;
        } else {
          clearInterval(jumpInterval);
          setIsJumping(false);
        }
      }, 20);
    }
  }, [isJumping]);

  useEffect(() => {
    if (gameStarted) {
      const handleKeyPress = (e) => {
        if (e.code === 'Space') {
          jump();
        }
      };
      window.addEventListener('keydown', handleKeyPress);
      return () => window.removeEventListener('keydown', handleKeyPress);
    }
  }, [gameStarted, jump]);

  useEffect(() => {
    if (gameStarted) {
      const gameInterval = setInterval(() => {
        setCactusX(x => {
          if (x <= -CACTUS_WIDTH) {
            setScore(s => s + 1);
            return GAME_WIDTH;
          }
          return x - 5;
        });
      }, 20);

      return () => clearInterval(gameInterval);
    }
  }, [gameStarted]);

  useEffect(() => {
    if (
      cactusX < DINO_WIDTH &&
      cactusX + CACTUS_WIDTH > 0 &&
      dinoY + DINO_HEIGHT > GAME_HEIGHT - CACTUS_HEIGHT - GROUND_HEIGHT
    ) {
      setGameStarted(false);
      setHighScore(s => Math.max(s, score));
      setScore(0);
      setCactusX(GAME_WIDTH);
    }
  }, [cactusX, dinoY, score]);

  const pixelStyle = {
    imageRendering: 'pixelated',
    fontFamily: "'Press Start 2P', cursive",
  };

  return (
    <div className="App" style={{ ...pixelStyle, textAlign: 'center' }}>
      <h1 style={{ fontSize: '24px', marginBottom: '20px' }}>Dino Runner</h1>
      <div style={{ position: 'relative', width: GAME_WIDTH, height: GAME_HEIGHT, margin: 'auto', border: '2px solid black' }}>
        {!gameStarted && (
          <button
            onClick={() => setGameStarted(true)}
            style={{
              position: 'absolute',
              top: '50%',
              left: '50%',
              transform: 'translate(-50%, -50%)',
              padding: '10px 20px',
              fontSize: '16px',
              cursor: 'pointer',
              ...pixelStyle,
            }}
          >
            Start Game
          </button>
        )}
        <div style={{
          position: 'absolute',
          bottom: GROUND_HEIGHT,
          left: 0,
          width: DINO_WIDTH,
          height: DINO_HEIGHT,
          backgroundColor: 'black',
          transform: `translateY(${GAME_HEIGHT - dinoY - DINO_HEIGHT}px)`,
        }} />
        <div style={{
          position: 'absolute',
          bottom: GROUND_HEIGHT,
          left: cactusX,
          width: CACTUS_WIDTH,
          height: CACTUS_HEIGHT,
          backgroundColor: 'green',
        }} />
        <div style={{
          position: 'absolute',
          bottom: 0,
          left: 0,
          width: '100%',
          height: GROUND_HEIGHT,
          backgroundColor: 'brown',
        }} />
      </div>
      <div style={{ marginTop: '20px', fontSize: '18px' }}>
        <p>Score: {score}</p>
        <p>High Score: {highScore}</p>
      </div>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
